  `fecbajcre` date DEFAULT NULL COMMENT 'Fecha de baja en asegurados',
  `iban` varchar(4) CHARACTER SET latin1 DEFAULT NULL COMMENT '4 primeros del iban de la cuenta',
  `SEPA_Refere` varchar(35) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Referencia de mandato',
  `SEPA_FecFirma` date DEFAULT NULL COMMENT 'Firma orden mandato'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

