/*Table structure for table `clientes_repetidos` */

DROP TABLE IF EXISTS `clientes_repetidos`;

CREATE TABLE `clientes_repetidos` (
  `id` int(11) NOT NULL DEFAULT '0',
  `codmacta` varchar(10) CHARACTER SET latin1 NOT NULL DEFAULT '0',
  `codmacta2` varchar(10) DEFAULT NULL,
  `nommacta` varchar(60) CHARACTER SET latin1 NOT NULL DEFAULT '0',
  `apudirec` char(1) CHARACTER SET latin1 NOT NULL DEFAULT '0',
  `model347` tinyint(1) NOT NULL DEFAULT '0',
  `razosoci` varchar(60) CHARACTER SET latin1 DEFAULT NULL,
  `dirdatos` varchar(30) CHARACTER SET latin1 DEFAULT '',
  `codposta` varchar(6) CHARACTER SET latin1 DEFAULT '',
  `despobla` varchar(30) CHARACTER SET latin1 DEFAULT '',
  `desprovi` varchar(30) CHARACTER SET latin1 DEFAULT NULL,
  `nifdatos` varchar(15) CHARACTER SET latin1 DEFAULT '',
  `maidatos` varchar(50) CHARACTER SET latin1 DEFAULT '',
  `webdatos` varchar(50) CHARACTER SET latin1 DEFAULT '',
  `obsdatos` text CHARACTER SET latin1,
  `pais` varchar(15) CHARACTER SET latin1 DEFAULT NULL,
  `entidad` varchar(4) CHARACTER SET latin1 DEFAULT NULL,
  `oficina` varchar(4) CHARACTER SET latin1 DEFAULT NULL,
  `CC` varchar(4) CHARACTER SET latin1 DEFAULT NULL,
  `cuentaba` varchar(10) CHARACTER SET latin1 DEFAULT NULL,
  `numpoliz` varchar(10) CHARACTER SET latin1 DEFAULT NULL,
  `fecsolic` date DEFAULT NULL,
  `credisol` decimal(14,2) DEFAULT NULL,
  `fecconce` date DEFAULT NULL,
  `credicon` decimal(14,2) DEFAULT NULL,
  `observa` text CHARACTER SET latin1,
  `fecbloq` date DEFAULT NULL,
  `forpa` smallint(6) DEFAULT NULL,
  `ctabanco` varchar(10) CHARACTER SET latin1 DEFAULT NULL,
  `grupotesoreria` varchar(20) CHARACTER SET latin1 DEFAULT NULL,
  `fecbajcre` date DEFAULT NULL COMMENT 'Fecha de baja en asegurados',
  `iban` varchar(4) CHARACTER SET latin1 DEFAULT NULL COMMENT '4 primeros del iban de la cuenta',
  `SEPA_Refere` varchar(35) CHARACTER SET latin1 DEFAULT NULL COMMENT 'Referencia de mandato',
  `SEPA_FecFirma` date DEFAULT NULL COMMENT 'Firma orden mandato'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

